import React from "react";
import "./Gardens.css";
import Plants from "../Plants/Plants";

function Gardens({ gardens }) {
  //display a header
  //iterate through each garden by referring to the gardens table in the backend and make a Garden component. Then in Garden iterate over plants

  const allPlants = gardens.plants.map((plant) => {
    return (
      <Plants>
        id={plant.id}
        key={plant.id}
        name={plant.name}
        image = {plant.img_url}
        description = {plant.description}
      </Plants>
    );
  });
  //display garden name
  //when looking at each garden, iterate through it's plants by using the table in the backend
  //display the plant name, img, description, and button to remove it from favorites
  //display a footer

  return (
    <div>
      <section className="MyGardenPage">
        <h2>{gardens.name}</h2>
        <div>{allPlants}</div>
      </section>
    </div>
  );
}

export default Gardens;
